ENBRIDGE PIPELINES (FSP) L.L.C.
RULES AND REGULATIONS
GOVERNING THE TRANSPORTATION OF
CRUDE PETROLEUM
BY PIPELINE
GENERAL APPLICATION The Rules and Regulations published herein apply only under tariffs making specific reference by FERC number to this tariff; such reference will include supplements hereto and successive issues hereof. Filed in compliance with 18 C.F.R. 341.3 (Form of tariff). The provisions published herein will, if effective, not result in an effect on the quality of the human environment.
ISSUED: December 4, 2023 EFFECTIVE: February 1, 2024
